Question: I'm using the AWS SDK for JavaScript in the Browser, with S3. In the following code the first call, getSignedUrl works fine but the second one to getObject fails with a CORS error - origin not allowed by Access-Control-Allow-Origin.

Has anyone any idea what obvious, simple and idiotic mistake I'm making?

```
AWS.config.update({accessKeyId: 'AAAAAAAAAAAA', secretAccessKey: 'ZZZZZZZZZ'});
 var s3 = new AWS.S3();
 var params = {Bucket: 'myBucket', Key: 'path/to/this/file.json'};

//this works...
 var url = s3.getSignedUrl('getObject', params);
 console.log(url);

//this doesn't...
 var obj = s3.getObject(params, function (error, data) {
  if (error) {
    console.log(error); // an error occurred
 } else {
    console.log(data); // request succeeded
}
});

```

